import React from 'react';
import {List, Datagrid, TextField, EditButton, ReferenceField, Edit, SimpleForm, ReferenceInput, SelectInput, TextInput, Create} from 'react-admin';

export const PendaftaranList = props => (
    <List {...props}>
        <Datagrid rowClick="edit">
            <ReferenceField source="passId" reference="pasien"><TextField source="id" /></ReferenceField>
            <TextField source="id" />
            <TextField source="nama" />
            <TextField source="nomorUrut" />
            <TextField source="biaya" />
            <EditButton />
        </Datagrid>
    </List>
);

export const PendaftaranEdit = props => (
    <Edit {...props}>
        <SimpleForm>
            <ReferenceInput source="passId" reference="pasien"><SelectInput optionText="id" /></ReferenceInput>
            <TextInput source="id" />
            <TextInput source="nama" />
            <TextInput source="nomorUrut" />
            <TextInput source="biaya" />
        </SimpleForm>
    </Edit>
);

export const PendaftaranCreate = props => (
    <Create {...props}>
        <SimpleForm>
            <ReferenceInput source="passId" reference="pasien"><SelectInput optionText="id" /></ReferenceInput>
            <TextInput source="id" />
            <TextInput source="nama" />
            <TextInput source="nomorUrut" />
            <TextInput source="biaya" />
        </SimpleForm>
    </Create>
);
